// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Header from './components/Header';
import Banner from './components/Banner';
import CourseCard from './components/CourseCard';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Switch>
          <Route path="/" exact>
            <Banner />
            <div className="course-list">
              <CourseCard title="Server orchestration with AWS" image="aws_image_url" />
              <CourseCard title="Supabase with NEXT.js" image="supabase_image_url" />
              <CourseCard title="Business PM" image="business_pm_image_url" />
            </div>
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
